import React, { Component } from 'react'

class AdvancedNavPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      items: [],
  
    };
    
  }
  render() {
    fetch('https://jsonplaceholder.typicode.com/todos/1' , {
      "method": "GET",
      "mode": "cors",  "content-type": "application/json",
      "accept": "application/json"
   
    })
  .then(response => response.json())
  .then(response => {
    this.setState({
     items: response
    })
  
 })
 return (
  <table>
  <thead>
      <tr>
          <th>ID</th>
          <th>Name</th>
          <th>Since</th>
      </tr>
  </thead>
  <tbody>
      {this.state.items.split('').map(ch=>{ console.log('Hello from map') })}
  </tbody>
</table>
);
}
}
      
    
  


export default AdvancedNavPage
